LL,NULL,'','2015/',NULL,NULL,'0000/00/00 00:00',10166,'パートナーに状況確認',NULL,1,'2015-04-07 10:54:07','－'),(492,492,NULL,NULL,'2015/03/16','2015/','-74','×','2015/',20271,'4/6に熊木より担当嶋田様にまごころ法務チェックの結果を確認。次回熊さん入れて事前キックオフMTG。Q2売上目標1,000万円\n\n4/2熊木より総務課長坂井様より役員会の検討結果をヒアリング。\n【結論】購買まごころサービス基本契約の締結は見送り。\n【理由】・先方としては自社ビル2つ(大阪、西宮)のコスト削減を希望していたが、全社的な取り組みとなると当初の想定と違っていた。\n<ビルについての先方希望項目>入居者管理、保守、営繕、修繕、収益的運用管理\n・全社的に購買項目自体が少ないために、削減効果を期待できない。','PSI押印済NDA送付済、次回経理データを受領予定',18,'2015-04-06 12:21:34',''),(493,493,NULL,NULL,'2015/03/06','2015/04/08','33','×','2015/04/08 17:23',20271,'4/6今田さん・熊木訪問。面談者小金沢様。パートナー契約および購買支援自社取組の提案。NDA・業務委託契約書はリーガルチェック中。先方不明点(契約期間、成功報酬の算出方法、契約締結支援業務の範囲など)を今田さんより管理部担当者様へ説明。ご理解済み。小金沢様からは、先方営業担当者の主な面談対象は店舗管理部長クラスなので、営業担当者からPSIへの経営者紹介は難しいかも知れないとのこと。小金沢様より先方社長へ紹介業務について説明して頂く。',NULL,3,'2015-04-06 12:21:34','－'),(494,494,NULL,NULL,'2015/03/23','2015/04/14','19','×','2015/04/14 00:00',20271,'4/14以下の内容にてMTG。参加者は今田さん、熊さん、熊木。\n・経理のミカタパートナー活動についての双方の候補企業の確認\n・まごころ600万円基本契約書、NDA、業務委託契約書の締結。リスケの連絡とまごころ法務チェックの進捗確認すること。\n・事前キックオフMTG。社内確認済。(今田さん、熊さん、熊木、AM担当上野さん)Q2売上目標100万円','',6,'2015-04-07 06:58:40','◎'),(495,495,NULL,NULL,'','2015/',NULL,'×',NULL,20271,'今田さんよりメールにてアポスケジュール依頼済み、代表者からの回答まち',NULL,1,'2015-04-07 10:54:07','〇'),(496,496,NULL,NULL,'2015/03/12','2015/','','×',NULL,20271,'一旦：STOP今田人脈にて再度アプローチタイミングもって対応',NULL,18,'2015-04-06 12:21:34','－'),(497,497,NULL,NULL,'','2015/','','','2015/04/10 00:00',50006,'サントリーの取組み履歴をヒアリング、水色ファイルも用意する。','3/13,18TEL。過去アプローチ履歴確認の上、再度岩切様に連絡を取る。',1,'2015-04-07 10:54:07','－'),(498,498,NULL,NULL,'2015/03/20','2015/04/17','39',NULL,'0000/00/00 00:00',10166,'アポ入れ、白黒。古市さん同行アポ入れ。総務系品目（コピー機、電話等）取組可否',NULL,3,'2015-04-01 10:14:10','－'),(499,499,NULL,NULL,'2015/','2015/',NULL,NULL,'2015/04/03 00:00',10267,'りそな総研様にご紹介の状況を確認　\n3月26日にTELで相談するが、もう少し待っていただきたいとのこと。3月30日に改めて連絡。',NULL,1,'2015-04-09 08:19:40','〇'),(500,500,NULL,NULL,'','2015/',NULL,NULL,'2015/04/03 17:25',10267,'りそな総研様にご紹介の状況を確認　\n3月26日にTELで相談するが、もう少し待っていただきたいとのこと。3月30日に改めて連絡。',NULL,1,'2015-04-07 